import React,{useState} from 'react'
import { TextField, Button, Typography, Paper} from '@material-ui/core';
import './Seller.css';
const Seller = () => {

    const [details,setDetails] = useState({
        name: '', email:'',number:'',address:'',pincode:'',type:''
    });

    const handleSubmit = (e) => {

        e.preventDefault();
        console.log(e.target.value);

    }



    return (
        <div className='main_container'>
            <div>
            <h1> Please Enter All the Details to be a Registered Seller</h1>
            </div>

            <div>
            <form onSubmit={(e) => handleSubmit(e)}>
                <div className="form_fields">
                <TextField name="name" variant="filled" label="Name"  color="primary" onChange={(e) => setDetails({...details,name: e.target.value})}/>
                <TextField name="email" variant="filled" label="Email"  onChange={(e) => setDetails({...details,email: e.target.value})}/>
                <TextField name="number" variant="filled" label="Number"  onChange={(e) => setDetails({...details,number: e.target.value})}/>
                <TextField name="address" variant="filled" label="Address"  onChange={(e) => setDetails({...details,address: e.target.value})}/>
                <TextField name="pincode" variant="filled" label="Pincode"  onChange={(e) => setDetails({...details,pincode: e.target.value})}/>
                <TextField name="type" variant="filled" label="Grocery/Medical"  onChange={(e) => setDetails({...details,type: e.target.value})}/>
                <Button type='submit' variant="contained" color="primary">Submit</Button>
                </div>
            </form>
            </div>
        </div>
    )
}

export default Seller
